import React from 'react'
import { useLocation } from 'react-router-dom';

function Dashboard() {
  const { state } = useLocation();
  const { marks, message, result } = state.response;
  const mystyle = {
    border:"1px solid black"
  };
  return (

    <div>
      <h2>This is dashboard</h2>
      <table style={mystyle}>
        <tr style={mystyle}>
          <th>Sub1</th>
          <th>Sub2</th>
          <th>Sub3</th>
          <th>Sub4</th>
          <th>Sub5</th>
          <th>Sub6</th>
        </tr>
        <tr style={mystyle}>
          <td>{marks.sub1}</td>
          <td>{marks.sub2}</td>
          <td>{marks.sub3}</td>
          <td>{marks.sub4}</td>
          <td>{marks.sub5}</td>
          <td>{marks.sub6}</td>
        </tr>
      </table>
      {console.log(message)}
      {console.log(result)}
    </div>

  )
}

export default Dashboard
